    sigma['CAAA'] += +0.50000000 * np.einsum('oa,pKRST,TA,SO,aBoR->pKBOA',Hbar['aa'],c['CAAA'],eta1['AA'],eta1['AA'],lambda2['aAaA'],optimize='optimal')
